 language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'We collect information about you during the checkout process on our store.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'What we collect and store'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'While you visit our site, we’ll track:'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Note: you may want to further detail your cookie policy, and link to that section from here.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Send you information about your account and order'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Respond to your requests, including refunds and complaints'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Process payments and prevent fraud'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Set up your account for our store'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Comply with any legal obligations we have, such as calculating taxes'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Improve our store offerings'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Send you marketing messages, if you choose to receive them'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'We will also store comments or reviews, if you choose to leave them.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Who on our team has access'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Order information like what was purchased, when it was purchased and where it should be sent, and'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Customer information like your name, email address, and billing and shipping information.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Our team members have access to this information to help fulfill orders, process refunds and support you.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'What we share with others'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'We share information with third parties who help us provide our orders and store services to you; for example --'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Payments'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'action started via %s'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'action complete via %s'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Monthly'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Every 15 Days'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Every minute'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Every %d minutes'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Shop and search results'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Shop only'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Search results only'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Hidden'=>['urls'=>[],'nam