woocommerce',1]],'PayPal Standard'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'PayPal Standard redirects customers to PayPal to enter their payment information.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Enable/Disable'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Enable PayPal Standard'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'This controls the title which the user sees during checkout.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'This controls the description which the user sees during checkout.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Pay via PayPal; you can pay with your credit card if you don\'t have a PayPal account.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'PayPal email'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Please enter your PayPal email address; this is needed in order to take payment.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Advanced options'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'PayPal sandbox'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Enable PayPal sandbox'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'PayPal sandbox can be used to test payments. Sign up for a <a href="%s">developer account</a>.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Debug log'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Enable logging'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Log PayPal events such as IPN requests and review them on the <a href="%s">Logs screen</a>. Note: this may log personal information. We recommend using this for debugging purposes only and deleting the logs when finished.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'IPN email notifications'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Enable IPN email notifications'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Send notifications when an IPN is received from PayPal indicating refunds, chargebacks and cancellations.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Receiver email'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'PayPal identity token'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Invoice prefix'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Please enter a prefix for your invoice numbers. If you use your PayPal account for multiple stores ensure this prefix is unique as PayPal will not allow orders with the same invoice number.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Shipping details'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Send shipping details to PayPal instead of billing.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Address override'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Enable "address_override" to prevent address information from being changed.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'PayPal verifies addresses therefore this setting can cause errors (we recommend keeping it disabled).'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Payment action'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Choose whether you wish to capture funds immediately or authorize payment only.'=>['urls'=>[],'names'=>[],'cmp'=>['woocommerce',1]],'Captur